private static final class NodeList extends org.jsoup.helper.ChangeNotifyingArrayList<org.jsoup.nodes.Node> {
    private final org.jsoup.nodes.Element owner;

    NodeList(org.jsoup.nodes.Element owner, int initialCapacity) {
        super(initialCapacity);
        this.owner = owner;
    }

    public void onContentsChanged() {
        owner.nodelistChanged();
    }
}

